import FormHeader from "./FormHeader";

function createEvent(){
    return(
        <div style={{
            boxSizing:"border-box",
            marginLeft: "auto",
            marginRight: "auto",
            padding: "2%",
            border: "1px solid black",
            borderRadius: "4px",
           backgroundColor: "white",
           height:"500px",
           width:"96%"
        }}>
         <FormHeader heading="Create New Event"/>
        </div>
    );
}
export default createEvent;
